#include<bits/stdc++.h>
using namespace std;
#define v vector
v<int>a, s;
v <v<int> >dp;

int f(int l, int r) {
  if (dp[l][r]) return dp[l][r];
  if (l==r) return dp[l][r] = a[l];
  return dp[l][r]=max(a[l]+s[r]-s[l]-f(l+1,r), a[r]+s[r-1]-s[l-1]-f(l, r-1));
}


int main()
{
	int n;
  scanf("%d",&n);
	a.resize(n+1);
	s.resize(n+1);
	dp.resize(n+1, v<int>(n+1));
	for (int i=1;i<=n;i++){
	  scanf("%d",&a[i]);
	  s[i]=s[i-1]+a[i];
	  
}
int mx = f(1, n);
if (mx >s[n]-mx)cout<<"Jahongir";
else
if (mx<s[n]-mx)cout<<"Azizxon";
else cout<<"Do'stlik";
